"use strict";function userName(){var e=prompt("Enter your name");alert("Hello, ".concat(e,"!"))}function userAge(){var e=2022-prompt("Enter your birth year");e<0?alert("You are not born yet!"):100<e?alert("Xa-xa! You are the same age as the dinosaur!"):alert("Your age is ".concat(e,"!"))}function squarePerimetr(){var e=prompt("Enter square side");alert("Square perimetr is: ".concat(Math.pow(e,2),"!"))}function circleSquare(){var e=prompt("Enter circle radius"),r=parseInt(Math.PI*Math.pow(e,2)*100);alert("Circle square is: ".concat(r/100,"!"))}function speed(){var e=prompt("Enter distance"),r=prompt("Enter travel time");alert("You need to move at a speed of ".concat(e/r," kilometers per hour!"))}function exchange(){var e=prompt("Enter the amount of dollars");alert("You will receive ".concat(.95*e," euros!"))}function cheangeLastNum(){var e=prompt("Введіть 5ти значне число"),r=1e4*(e%10)+parseInt(e/10);5===e.length?alert(r):alert("Ви ввели не 5ти значне число, спробуйте ще раз!")}function monthSalary(){var e=prompt("Вкажіть суму продажів за місяць");alert("Ваша зарплата за цей міяць: ".concat(250+10*e/100," $"))}